    "# Description\n\nNextcloud OCR (optical character recognition) processing for images and PDF with tesseract-js brings OCR capability to your Nextcloud.\nThe app uses tesseract-js in the browser in order to process images (png, jpeg, tiff, bmp) and small PDFs and saves the output file to the source folder in nextcloud. That for example enables you to search in it.\n\n## Prerequisites, Requirements and Dependencies\nThe OCR app has some prerequisites:\n\n - [Nextcloud 16 and up](https://nextcloud.com/)\n\n - Only supported on latest modern web browsers (Chrome, Edge, Firefox, Opera, Safari*)\n\n - Tesseract traineddata needs about 200 MB space on your server (will be installed automatically).\n\n\n_* On Safari there is currently a problem with the [Content-Security-Policy](https://developer.mozilla.org/en-US/docs/Web/HTTP/CSP), that requires an Administrator to set the 'script-src' to 'unsafe-eval' such that the app works properly. Because this is quite insecure the app itself does not set it and recommends to decide that on your own risk (please make sure, that you know what CSP is and what e.g. unsafe-eval causes)._\n\n## Installation\nInstall the app from the [Nextcloud AppStore](http://apps.nextcloud.com) or download the release package from github (**NOT** the sources) and place the content in **nextcloud/apps/ocr/**.\n\n## Disclaimer\nThe software is distributed on an \"AS IS\" BASIS, WITHOUT WARRANTIES OR\nCONDITIONS OF ANY KIND, either express or implied.\n\n## Consideration\nThe version 3 and earlier versions are not supported/maintained anymore by the author. So for asynchronous background processing please fork the repository and use the \"not-maintained\" branch to work on improvements. The author wasn't able to support it because of too much effort.\nMoreover this project is based on a webassembly port of tesseract and some in browser tools for pdf handling, which especially in case of processing PDF files leads to quite some overhead compared to tools like [OCRmyPDF](https://github.com/jbarlow83/OCRmyPDF). Please consider, that output files can get quite big and the process may take quite long, too." : "＃说明\n\n使用 tesseract-js 对图像和 PDF 进行 Nextcloud OCR（光学字符识别）处理以为您的 Nextcloud 带来 OCR 功能。\n该应用程序在浏览器中使用 tesseract-js 来处理图像（png，jpeg，tiff，bmp）和小的 PDF，并将输出文件保存到 nextcloud 的源文件夹中。 例如，您可以在其中进行搜索。\n\n## 先决条件，要求和依赖关系\nOCR 应用程序具有一些先决条件：\n\n - [Nextcloud 15 及以上版本](https://nextcloud.com/)\n\n- 仅在最新的现代网络浏览器（Chrome，Edge，Firefox，Opera，Safari *）上受支持\n\n- Tesseract 训练有素的数据需要大约 200 MB 的空间存放在您的服务器上（将自动安装）。\n\n\n_* 在 Safari 上，当前的 [内容安全政策](https://developer.mozilla.org/en-US/docs/Web/HTTP/CSP) 存在问题，要求管理员将 “script-src” 设置为 “不安全评估”，以使应用正常运行。 由于这是非常不安全的，因此应用程序本身不会对其进行设置，因此建议您自行承担风险（请确保您知道 CSP 是什么，以及造成不安全评估的原因）。_\n\n## 安装\n从 [Nextcloud 应用商店](http://apps.nextcloud.com) 安装应用或从 github 下载发行包（**不是** 源代码）然后将内容放在 **nextcloud/apps/ocr/** 中\n\n## 免责声明\n该软件以 “现状” 为基础分发，没有任何明示或暗示的保证或条件。\n\n## 考虑\n作者不再支持 / 维护版本 3 及更早版本。 因此，对于异步后台处理，请 Fork 存储库，并使用 “未维护” 分支进行改进。 由于过多的努力，作者无法提供支持。\n此外，该项目基于 tesseract 的 Webassembly 端口和一些用于 pdf 处理的浏览器工具，特别是在处理 PDF 文件的情况下，与  [OCRmyPDF](https://github.com/jbarlow83/OCRmyPDF) 之类的工具相比，这会导致相当多的开销。 输出文件可能会变得很大，并且该过程可能还会花费很长时间，请斟酌。",
